import React from 'react';
import { FormControl, FormGroup, InputLabel, Input } from '@mui/material';

const AddSubmissionType = () => {
    return(
        <FormGroup>
            <FormControl>
                <InputLabel>Name</InputLabel>
                <Input/>
            </FormControl>
            <FormControl>
                <InputLabel>Type</InputLabel>
                <Input/>
            </FormControl>
        </FormGroup>
        )

}

export default AddSubmissionType;
